import {
  IonButton,
  IonButtons,
  IonContent,
  IonFooter,
  IonIcon,
  IonItem,
  IonLabel,
  IonList,
  IonListHeader,
  IonMenu,
  IonMenuToggle,
  IonNote,
  IonTitle,
  IonToolbar,
} from "@ionic/react";

import { useLocation } from "react-router-dom";
import {
  businessOutline,
  businessSharp,
  calendarOutline,
  calendarSharp,
  gridOutline,
  gridSharp,
  home,
  homeOutline,
  peopleOutline,
  peopleSharp,
  personOutline,
  personSharp,
  starOutline,
  starSharp,
} from "ionicons/icons";
import "./Menu.css";

interface AppPage {
  url: string;
  iosIcon: string;
  mdIcon: string;
  title: string;
}
interface Admin {
  name: string;
  surname: string;
}

const admin: Admin = {
  name: "name",
  surname: "surname",
};

const appPages: AppPage[] = [
  {
    title: "Dashboard",
    url: "/dashboard",
    iosIcon: homeOutline,
    mdIcon: home,
  },
  {
    title: "Calendar",
    url: "/calendar",
    iosIcon: calendarOutline,
    mdIcon: calendarSharp,
  },
  {
    title: "Agent Management",
    url: "/agent",
    iosIcon: peopleOutline,
    mdIcon: peopleSharp,
  },
  {
    title: "Complex Management",
    url: "/complex",
    iosIcon: businessOutline,
    mdIcon: businessSharp,
  },
  {
    title: "Package Management",
    url: "/package",
    iosIcon: gridOutline,
    mdIcon: gridSharp,
  },
  {
    title: "Promotion Management",
    url: "/promotion",
    iosIcon: starOutline,
    mdIcon: starSharp,
  },
  {
    title: "Profile",
    url: "/profile",
    iosIcon: personOutline,
    mdIcon: personSharp,
  },
];

const Menu: React.FC = () => {
  const location = useLocation();

  return (
    <IonMenu contentId="main" type="overlay">
      <IonContent>
        <IonList id="inbox-list">
          <IonListHeader>The Green Wash Admin</IonListHeader>
          <IonNote>
            {admin.name} {admin.surname}
          </IonNote>
          {appPages.map((appPage, index) => {
            return (
              <IonMenuToggle key={index} autoHide={false}>
                <IonItem
                  className={
                    location.pathname === appPage.url ? "selected" : ""
                  }
                  routerLink={appPage.url}
                  routerDirection="none"
                  lines="none"
                  detail={false}
                >
                  <IonIcon
                    slot="start"
                    ios={appPage.iosIcon}
                    md={appPage.mdIcon}
                  />
                  <IonLabel>{appPage.title}</IonLabel>
                </IonItem>
              </IonMenuToggle>
            );
          })}
        </IonList>
        <IonFooter>
          <IonToolbar>
            <IonButtons slot="start" color="primary">
              <IonButton href="/signIn">Sign Out</IonButton>
            </IonButtons>
          </IonToolbar>
        </IonFooter>
      </IonContent>
    </IonMenu>
  );
};

export default Menu;
